import React,{createContext,useState} from 'react'

import img1 from '../images/amloki.jpeg';
import img2 from "../images/garlic.jpg";
import img3 from "../images/lemon.jpg";
import img4 from "../images/mango.jpeg";
import img5 from "../images/lemon.jpg";
import img6 from "../images/mago.jpeg";
import img7 from "../images/garlic.jpg";
import img8 from "../images/amloki.jpeg";


export const ProductContext=createContext();

const ProductContextProvider = (props) => {
    const [products] = useState([
        {id:1,name:"Amloki Achar",price:300,image:img1,status:"new"},
        {id:2,name:"Garlic Achar",price:300,image:img2,status:"regular"},
        {id:3,name:"Lemon Achar",price:350,image:img3,status:"new"},
        {id:4,name:"Amloki Achar",price:250,image:img4,status:"regular"},
        {id:5,name:"Lemon Achar",price:400,image:img5,status:"regular"},
        {id:6,name:"Mango Achar",price:300,image:img6,status:"new"},
        {id:7,name:"Garlic Achar",price:300,image:img7,status:"regular"},
        {id:8,name:"Amloki Achar",price:300,image:img8,status:"new"},

    ])
    return (
        <ProductContext.Provider value={{products:[...products]}}>
            {props.children}
        </ProductContext.Provider>
    )
}

export default ProductContextProvider;
